// Navbar.js
import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <div className="navbar">
      <Link to="/products">Products</Link>
      <Link to="/statistics">Statistics</Link>
    </div>
  );
};

export default Navbar;
